(24, 'Time to leave Varkal and head to Alleppey.', 'time-to-leave-varkal-and-head-to-alleppey', '<p>Time to leave Varkal and head to Alleppey.&nbsp;<br />\r\n<br />\r\nTook a Tuk Tuk to the train station, missed the train by 10 minutes, so had to take the next in direct train, once we arrived at station at 1pm, the next train wasn&#39;t until 6.30pm.. Waaaa!! There was another three people outside in the same situation as us, so we all decided to share a taxi as it was only about one hour away.&nbsp;<br />\r\n<br />\r\nEveryone comes to Allepey for the backwaters, we&#39;ve booked the beach part, but apparently the beach isn&#39;t great, we&#39;ll see.&nbsp;<br />\r\n<br />\r\nDriving through the beachfront and there was this massive bridge construction thing going on, dusty, big pillars being put in.. looked bloody awful!! But the taxi drove straight past that, thank goodness!&nbsp;<br />\r\n<br />\r\nPulled up to sea breeze guesthouse, the owner was really friendly, giving us drinks, shown to our room, nice, really clean, three of us in there, so had another camp sort of bed put in, then it was a little cramped but, but we&#39;re paying about &pound;3 each a night, so can&#39;t complain. Watched the sunset from the rooftop, then headed over to Catamaran cafe for some&nbsp;</p>\r\n\r\n<p>&gt;<img alt=\"Cute guy.. Paddling us around\" src=\"https://photos.travelblog.org/Photos/187936/1010558/t/9752243-Cute-guy--Paddling-us-around-0.jpg\" /><img alt=\"Cute guy.. Paddling us around\" src=\"https://www.travelblog.org/pix/shim.gif\" />Cute guy.. Paddling us around</p>\r\n\r\n<p>food.. Such a nice place, huge, all open to the beach.. Corr all the guys who work in there are soo hot and have the most amazing hair ????&nbsp;</p>\r\n', '', 'hodka2.jpg', 'blog', 1519462885, 1519462885);
